import Navbar from "./components/navbar/navbar";

function App() {
  let Component;
  switch (window.location.pathname) {
    case "/":
      Component = App;
      break;
    case "/Schedule":
      Component = Schedule;
      break;
    case "/Teams":
      Component = Teams;
      break;
    case "/Standings":
      Component = Standings;
      break;
    case "/News":
      Component = News;
      break;
    case "/Youth":
      Component = Youth;
      break;
    case "/Offseason":
      Component = Offseason;
      break;
    case "/History":
      Component = History;
      break;
  }
  return <Navbar />;
}

export default App;
